  [],\n\t\"revision_timestamp\": \"2016-07-27T22:24:10.231343\",\n\t\"name\": \"flint-hills-national-wildlife-refuge-and-marais-des-cygnes-national-wildlife-refuge-annua--880bb\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Flint
  Hills National Wildlife Refuge and Marais Des Cygnes National Wildlife Refuge summarizes
  refuge activities during the 2002 calendar year.  The report begins with a summary
  of the yearu2019s highlights and climatic conditions.   Land acquisition-including
  fee title, and other is also covered.  The report includes a planning section which
  discusses management plan.  Refuge administration is outlined; information about
  personnel, youth programs, volunteer programs, funding, safety, and other items
  is given.  Habitat management is also covered.  Subjects include general, wetlands,
  forests, cropland, grassland, other habitats, grazing, fire management, pest control,
  and water rights.  The wildlife section of the report discusses wildlife diversity,
  endangered and/or threatened species, waterfowl, marsh and water birds, shorebirds,
  gulls, terns, and allied species, raptors, other migratory birds, game mammals,
  other residents wildlife, and fisheries resources.  The public uses of the refuge
  described in this report include general, outdoor student and teacher classrooms,
  interpretive foot trails, interpretive exhibits/demonstrations, hunting, fishing,
  trapping, wildlife observation, other wildlife oriented recreation, camping, picnicking,
  off road vehicling, other non-wildlife oriented recreation, law enforcement, cooperating
  associations and concessions.  The equipment and facilities section of the report
  provides information about new construction, rehabilitation, equipment utilization
  and replacement, computer systems, energy conservation and other.  Items of interest
  are provided at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
